import React from 'react'

function NavBar() {
    return (
        <div className="navbar">
            <button className="btn selected">Popular</button>
            <button className="btn not-selected">Recent</button>
            <button className="btn not-selected">Upvoted</button>
            <button className="btn not-selected">Discussed</button>
        </div>
    )
}

export default NavBar
